import React from 'react';
import './index.css';
import TaskDisplay from './components/TaskDisplay.js'

function App() {

  return (
    <div className="grid grid-cols-1 gap-4 m-5 justify-center">
      <div>
        <h1 className="text-3xl font-bold font-sans">My Tasks</h1>
      </div>
      <TaskDisplay></TaskDisplay>
      <div>
        <button className="w-5 h-5 border border">+</button>
      </div>
    </div>
  );
}

export default App;
